// src/workers/stockfish.worker.js

// Load Stockfish (nnue version) from the public CDN.
importScripts('https://cdn.jsdelivr.net/npm/stockfish@16.0.0/src/stockfish-nnue-16.min.js');

// The loaded script defines the global STOCKFISH function.
const engine = STOCKFISH();

// Relay all messages from Stockfish back to the main thread.
engine.onmessage = function(event) {
  postMessage(event.data);
};

// When a message is received from the main thread, forward it to Stockfish.
onmessage = function(event) {
  engine.postMessage(event.data);
};
